import React from 'react';

import Button from '../../UserInterface/Buttons/Button/Button'
import ButtonLink from '../../UserInterface/Buttons/Button/ButtonLink'


function ConsoleButton (props){
    
    const stateButton = props.stateConsoleButton;

    return(
        <div className={props.classnameWrapper}>
            <Button 
                    onclick={stateButton[0].onclick}
                    onmouseover={props.onmouseover}
                    onmouseleave={props.onmouseleave}
                    tabindex = {props.tabindex}
                    text = {stateButton[0].text}
                    icon = {stateButton[0].icon}
                />
            <ButtonLink 
                    to={props.linkWindowEdit}
                    onclick={stateButton[1].onclick}
                    onmouseover={props.onmouseover}
                    onmouseleave={props.onmouseleave}
                    tabindex = {props.tabindex}
                    text = {stateButton[1].text}
                    icon = {stateButton[1].icon}
                />
            <ButtonLink 
                    to={props.linkWindowEdit}
                    onclick={props.onclick3}
                    onmouseover={props.onmouseover}
                    onmouseleave={props.onmouseleave}
                    tabindex = {props.tabindex}
                    text = {stateButton[2].text}
                    icon = {stateButton[2].icon} 
                />
            <ButtonLink
                    to={props.linkWindowConfirmDeleting}
                    onclick={props.onclick4}
                    onmouseover={props.onmouseover}
                    onmouseleave={props.onmouseleave}
                    tabindex = {props.tabindex}
                    text = {stateButton[3].text}
                    icon = {stateButton[3].icon}
                />
            <Button 
                    onclick={props.onclick5}
                    onmouseover={props.onmouseover}
                    onmouseleave={props.onmouseleave}
                    tabindex = {props.tabindex}
                    text = {stateButton[4].text}
                    icon = {stateButton[4].icon}
                />
        </div>
    )
}

export default ConsoleButton
